phy Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"AREA_DESC":{"type":"string","alias":"AREA_DESC","vintage":null,"source":null,"units":null,"decimals":null},"STORE_NAME":{"type":"string","alias":"STORE_NAME","vintage":null,"source":null,"units":null,"decimals":null},"CHART_POINT_VALUE":{"type":"number","alias":"CHART_POINT_VALUE","vintage":null,"source":null,"units":null,"decimals":null},"STORE_ADDR":{"type":"string","alias":"STORE_ADDR","vintage":null,"source":null,"units":null,"decimals":null},"AREA_DESC2":{"type":"string","alias":"AREA_DESC2","vintage":null,"source":null,"units":null,"decimals":null},"STORE_LAT":{"type":"string","alias":"STORE_LAT","vintage":null,"source":null,"units":null,"decimals":null},"STORE_LONG":{"type":"string","alias":"STORE_LONG","vintage":null,"source":null,"units":null,"decimals":null},"SITE_NAME":{"type":"string","alias":"SITE_NAME","vintage":null,"source":null,"units":null,"decimals":null}},"dataCollectionsCalculator":{"STORE_ID":{"type":"string","alias":"STORE_ID","vintage":null,"source":null,"units":null,"decimals":null},"AREA_ID":{"type":"string","alias":"AREA_ID","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyName":{"type":"string","alias":"Standard geography name","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyID":{"type":"string","alias":"Standard geography Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"ATRISKTOTPOPCY":{"type":"number","alias":"2023 Total Population","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSHHGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Households","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Families","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of families between the years 2023 and 2028. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"BUSINESSESS01BUS":{"type":"number","alias":"2023 Total Businesses (SIC)","vintage":"2023","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total number of Businesses with Standard Industrial Classification (SIC) Code 01-99 in the geographic area. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"DAYTIMEPOPULATIONDPOPCY":{"type":"number","alias":"2023 Total Daytime Population","vintage":"2023","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Daytime Population in the geographic area. Total Daytime Population includes workers (civilian, non-military employed at work, and armed forces personnel ages 16+) and residents (population age 0-15, unemployed adults, those not in the labor force, and employed civilians who are not working temporarily due to illness, vacation, etc.). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"INDUSTRYEMPCY":{"type":"number","alias":"2023 Employed Civilian Pop 16+","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Employed Civilian Population Age 16+ in the geographic area. Employed Civilian Population include those who are non-military employees or are self-employed, including those who work 15 hours or more for a family business (paid or unpaid) or those who are temporarily absent from work due to illness, vacation, or other personal reasons. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"INDUSTRYUNEMPCY":{"type":"number","alias":"2023 Unemployed Population 16+","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Unemployed Population Age 16+ in the geographic area. Unemployed Population include those who are not on active duty in the Armed Forces, neither currently working nor waiting to work a job they hold, and have actively sought employment during the past four weeks and are available to work if hired; includes temporarily laid off employees. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EMPLOYMENTUNEMPLOYMENTUNEMPRTCY":{"type":"number","alias":"2023 Unemployment Rate","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Unemployment Rate of Population Age 16+ in the geographic area. The Unemployment Rate represents the total number of unemployed persons as a percentage of the Civilian Labor Force. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"SPENDINGTOTALX1001X_A":{"type":"number","alias":"2023 Annual Budget Expenditures: Average","vintage":"2023","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Annual Budget Expenditures</em> in the geographic area. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"HEALTHX8001X_A":{"type":"number","alias":"2023 Health Care: Average","vintage":"2023","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Health Care</em> in the geographic area. Includes expected spending on Health Insurance and Medical Care. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"HEALTHACS65NOHI":{"type":"number","alias":"2021 Pop 65+: No Health Insur (ACS 5-Yr)","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the Population age 65+ with No Health Insurance Coverage in the geographic area. Those whose only health coverage is Indian Health Service, or plans that only provide insurance for specific conditions such as cancer and long-term care policies are considered uninsured. Population includes U.S. civilians (not active duty Armed Forces) who do not reside in institutional group quarters facilities. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"ATRISKACSHHBPOV_P":{"type":"number","alias":"2021 HHs: Inc Below Poverty Level (ACS 5-Yr): Percent","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"AGEDEPENDENCYSENIORCY_P":{"type":"number","alias":"2023 Senior Population: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the total Senior Population (Age 65+) in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKACSSNAP_P":{"type":"number","alias":"2021 HHs w/Food Stamps/SNAP (ACS 5-Yr): Percent","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households Receiving Food Stamps or SNAP in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"INTERNETCOMPUTERUSAGEACSNONET_P":{"type":"number","alias":"2021 HHs w/No Internet Access (ACS 5-Yr): Percent","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households with No Internet Access in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"KEYUSFACTSTOTPOP00":{"type":"number","alias":"2000 Total Population","vintage":"2000","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2000 count of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in Group Quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks."},"AGEBYRACEBYSEX2010TOTPOP10":{"type":"number","alias":"2010 Total Population","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"KEYUSFACTSTOTPOP20":{"type":"number","alias":"2020 Total Population","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total population includes those living in households, on active duty in the Armed Forces, and those living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, etc. Source U.S. Census 2020. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"AGEBYRACEBYSEXTOTPOPFY":{"type":"number","alias":"2028 Total Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, military barracks, and college dorms.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTHHCY":{"type":"number","alias":"2023 Total Households","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINCCY":{"type":"number","alias":"2023 Median Household Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"CIVICACTIVITIESPOLITICALAFFILIATIONMP06010AB_P":{"type":"number","alias":"2023 Voted in Federal/State/Local Election/12 Mo: Percent","vintage":"2023","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Voted in Federal or State or Local Election Last 12 Mo</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"HOMEVALUEMEDVALCY":{"type":"number","alias":"2023 Median Home Value","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSEHOLDTOTALSINCMORTCY":{"type":"number","alias":"2023 Pct of Income for Mortgage","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Percent of Income for Mortgage (POIFM) in the geographic area. This is the median percentage of household income dedicated to mortgage payments for a home priced at the median value. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"CIVICACTIVITIESPOLITICALAFFILIATIONMP06002AB_P":{"type":"number","alias":"2023 Attended Public Mtg on Town/School Affairs/12 Mo: Percent","vintage":"2023","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Attended Public Meeting on Town or School Affairs Last 12 Mo</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"PSYCHOGRAPHICSSHOPPINGMP28819ABP":{"type":"number","alias":"2023 Prefer Local vs National Stores: 3-Agr Smwht: Percent","vintage":"2023","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Prefer to Shop Local vs National Store Chains: 3-Agree Somewhat</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 120 this implies that consumer demand in the geographic area is likely to be 20% more than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"MISCELLANEOUSX12021X_A":{"type":"number","alias":"2023 Cash Gifts to Charities: Average","vintage":"2023","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Cash Gifts to Charities</em> in the geographic area. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"HOUSEHOLDTOTALSTOTHH00":{"type":"number","alias":"2000 Total Households","vintage":"2000","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2000 count total households in the geographic area. Households are persons living in a housing unit. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered group quarters."},"HOUSINGUNITTOTALSTOTHU10":{"type":"number","alias":"2010 Total Housing Units","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Housing Units in the geographic area. See <a target='_blank' //links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"HOUSINGUNITTOTALSTOTHU20":{"type":"number","alias":"2020 Total Housing Units","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total Housing Units (occupied and vacant). Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupant’s usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Source U.S. Census 2020. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HISTORICALHOUSINGTOTHUCY":{"type":"number","alias":"2023 Total Housing Units","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of Total Housing Units, occupied or vacant, in the geographic area. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters. Occupants can be individuals, roommates, families who live together, or any other group of related or unrelated people who share living arrangements. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSTOTHUFY":{"type":"number","alias":"2028 Total Housing Units","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Total Housing Units (occupied or vacant) in the geographic area. Occupied Housing Units are currently occupied living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. Occupants can be individuals, unrelated roommates, or families who live together. For vacant housing units, the living space criteria is identical to that of occupied units. Some nontraditional living quarters—such as boats, RVs, and tents—are counted as housing units only when occupied if it is either the occupant’s usual residence or if the occupant has no other residence elsewhere. Importantly, these nontraditional living quarters are not counted as vacant housing units when unoccupied. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSTOTHU00":{"type":"number","alias":"2000 Total Housing Units","vintage":"2000","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of Total Housing Units in the geographic area. Total Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupant’s usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Based on U.S. Census 2010 data. See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"AGEBYRACEBYSEX2010TOTHH10":{"type":"number","alias":"2010 Total Households","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence.See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"HOUSEHOLDTOTALSTOTHH20":{"type":"number","alias":"2020 Total Households","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total Households is the total of occupied housing units. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered group quarters. Source U.S. Census 2020. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"AGEBYRACEBYSEXTOTHHFY":{"type":"number","alias":"2028 Total Households","vintage":"2028","source":"Esri","units":nu at describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY":{"id":"HHGRWCYFY","fullName":"KeyUSFacts.HHGRWCYFY","alias":"2023-2028 Growth Rate: Households","fieldName":"KEYUSFACTSHHGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY":{"id":"FAMGRWCYFY","fullName":"KeyUSFacts.FAMGRWCYFY","alias":"2023-2028 Growth Rate: Families","fieldName":"KEYUSFACTSFAMGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of families between the years 2023 and 2028. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.BUSINESSESS01BUS":{"id":"S01_BUS","fullName":"businesses.S01_BUS","alias":"2023 Total Businesses (SIC)","fieldName":"BUSINESSESS01BUS","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.BUSINESSESS01BUS","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-Data Axle","definition":"Esri 2023 Estimate (#) of the Total number of Businesses with Standard Industrial Classification (SIC) Code 01-99 in the geographic area. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"dataCollectionsCalculator.DAYTIMEPOPULATIONDPOPCY":{"id":"DPOP_CY","fullName":"DaytimePopulation.DPOP_CY","alias":"2023 Total Daytime Population","fieldName":"DAYTIMEPOPULATIONDPOPCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.DAYTIMEPOPULATIONDPOPCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-Data Axle","definition":"Esri 2023 Estimate (#) of the Total Daytime Population in the geographic area. Total Daytime Population includes workers (civilian, non-military employed at work, and armed forces personnel ages 16+) and residents (population age 0-15, unemployed adults, those not in the labor force, and employed civilians who are not working temporarily due to illness, vacation, etc.). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.INDUSTRYEMPCY":{"id":"EMP_CY","fullName":"industry.EMP_CY","alias":"2023 Employed Civilian Pop 16+","fieldName":"INDUSTRYEMPCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.INDUSTRYEMPCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Employed Civilian Population Age 16+ in the geographic area. Employed Civilian Population include those who are non-military employees or are self-employed, including those who work 15 hours or more for a family business (paid or unpaid) or those who are temporarily absent from work due to illness, vacation, or other personal reasons. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.INDUSTRYUNEMPCY":{"id":"UNEMP_CY","fullName":"industry.UNEMP_CY","alias":"2023 Unemployed Population 16+","fieldName":"INDUSTRYUNEMPCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.INDUSTRYUNEMPCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Unemployed Population Age 16+ in the geographic area. Unemployed Population include those who are not on active duty in the Armed Forces, neither currently working nor waiting to work a job they hold, and have actively sought employment during the past four weeks and are available to work if hired; includes temporarily laid off employees. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.EMPLOYMENTUNEMPLOYMENTUNEMPRTCY":{"id":"UNEMPRT_CY","fullName":"EmploymentUnemployment.UNEMPRT_CY","alias":"2023 Unemployment Rate","fieldName":"EMPLOYMENTUNEMPLOYMENTUNEMPRTCY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.EMPLOYMENTUNEMPLOYMENTUNEMPRTCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Unemployment Rate of Population Age 16+ in the geographic area. The Unemployment Rate represents the total number of unemployed persons as a percentage of the Civilian Labor Force. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.SPENDINGTOTALX1001X_A":{"id":"X1001_X_A","fullName":"SpendingTotal.X1001_X_A","alias":"2023 Annual Budget Expenditures: Average","fieldName":"SPENDINGTOTALX1001X_A","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.SPENDINGTOTALX1001X_A","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-U.S. BLS","definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Annual Budget Expenditures</em> in the geographic area. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"dataCollectionsCalculator.HEALTHX8001X_A":{"id":"X8001_X_A","fullName":"Health.X8001_X_A","alias":"2023 Health Care: Average","fieldName":"HEALTHX8001X_A","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHX8001X_A","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-U.S. BLS","definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Health Care</em> in the geographic area. Includes expected spending on Health Insurance and Medical Care. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"dataCollectionsCalculator.HEALTHACS65NOHI":{"id":"ACS65NOHI","fullName":"Health.ACS65NOHI","alias":"2021 Pop 65+: No Health Insur (ACS 5-Yr)","fieldName":"HEALTHACS65NOHI","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHACS65NOHI","type":"esriFieldTypeDouble","vintage":"2017-2021","source":"ACS","definition":"ACS five-year estimate of the Population age 65+ with No Health Insurance Coverage in the geographic area. Those whose only health coverage is Indian Health Service, or plans that only provide insurance for specific conditions such as cancer and long-term care policies are considered uninsured. Population includes U.S. civilians (not active duty Armed Forces) who do not reside in institutional group quarters facilities. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"dataCollectionsCalculator.ATRISKACSHHBPOV_P":{"id":"ACSHHBPOV_P","fullName":"AtRisk.ACSHHBPOV_P","alias":"2021 HHs: Inc Below Poverty Level (ACS 5-Yr): Percent","fieldName":"ATRISKACSHHBPOV_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKACSHHBPOV_P","type":"esriFieldTypeDouble","vintage":"2017-2021","source":"ACS","definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"dataCollectionsCalculator.AGEDEPENDENCYSENIORCY_P":{"id":"SENIOR_CY_P","fullName":"AgeDependency.SENIOR_CY_P","alias":"2023 Senior Population: Percent","fieldName":"AGEDEPENDENCYSENIORCY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.AGEDEPENDENCYSENIORCY_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the total Senior Population (Age 65+) in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/u ALTHMEDHINCCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.CIVICACTIVITIESPOLITICALAFFILIATIONMP06010AB_P":{"id":"MP06010A_B_P","fullName":"CivicActivitiesPoliticalAffiliation.MP06010A_B_P","alias":"2023 Voted in Federal/State/Local Election/12 Mo: Percent","fieldName":"CIVICACTIVITIESPOLITICALAFFILIATIONMP06010AB_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CIVICACTIVITIESPOLITICALAFFILIATIONMP06010AB_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-MRI-Simmons","definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Voted in Federal or State or Local Election Last 12 Mo</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"dataCollectionsCalculator.HOMEVALUEMEDVALCY":{"id":"MEDVAL_CY","fullName":"homevalue.MEDVAL_CY","alias":"2023 Median Home Value","fieldName":"HOMEVALUEMEDVALCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOMEVALUEMEDVALCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSEHOLDTOTALSINCMORTCY":{"id":"INCMORT_CY","fullName":"householdtotals.INCMORT_CY","alias":"2023 Pct of Income for Mortgage","fieldName":"HOUSEHOLDTOTALSINCMORTCY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSINCMORTCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Percent of Income for Mortgage (POIFM) in the geographic area. This is the median percentage of household income dedicated to mortgage payments for a home priced at the median value. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.CIVICACTIVITIESPOLITICALAFFILIATIONMP06002AB_P":{"id":"MP06002A_B_P","fullName":"CivicActivitiesPoliticalAffiliation.MP06002A_B_P","alias":"2023 Attended Public Mtg on Town/School Affairs/12 Mo: Percent","fieldName":"CIVICACTIVITIESPOLITICALAFFILIATIONMP06002AB_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CIVICACTIVITIESPOLITICALAFFILIATIONMP06002AB_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-MRI-Simmons","definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Attended Public Meeting on Town or School Affairs Last 12 Mo</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"dataCollectionsCalculator.PSYCHOGRAPHICSSHOPPINGMP28819ABP":{"id":"MP28819A_B_P","fullName":"PsychographicsShopping.MP28819A_B_P","alias":"2023 Prefer to Shop Local vs National Store Chains: 3-Agree Somewhat (%)","fieldName":"PSYCHOGRAPHICSSHOPPINGMP28819ABP","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.PSYCHOGRAPHICSSHOPPINGMP28819ABP","type":"esriFieldTypeDouble","vintage":null,"source":null},"dataCollectionsCalculator.MISCELLANEOUSX12021X_A":{"id":"X12021_X_A","fullName":"miscellaneous.X12021_X_A","alias":"2023 Cash Gifts to Charities: Average","fieldName":"MISCELLANEOUSX12021X_A","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.MISCELLANEOUSX12021X_A","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-U.S. BLS","definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Cash Gifts to Charities</em> in the geographic area. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH00":{"id":"TOTHH00","fullName":"householdtotals.TOTHH00","alias":"2000 Total Households","fieldName":"HOUSEHOLDTOTALSTOTHH00","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH00","type":"esriFieldTypeDouble","vintage":"2000","source":"U.S. Census","definition":"U.S. Census 2000 count total households in the geographic area. Households are persons living in a housing unit. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered group quarters."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU10":{"id":"TOTHU10","fullName":"housingunittotals.TOTHU10","alias":"2010 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU10","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Total Housing Units in the geographic area. See <a target='_blank' //links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU20":{"id":"TOTHU20","fullName":"housingunittotals.TOTHU20","alias":"2020 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU20","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"Total Housing Units (occupied and vacant). Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupant’s usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Source U.S. Census 2020. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HISTORICALHOUSINGTOTHUCY":{"id":"TOTHU_CY","fullName":"HistoricalHousing.TOTHU_CY","alias":"2023 Total Housing Units","fieldName":"HISTORICALHOUSINGTOTHUCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HISTORICALHOUSINGTOTHUCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Total Housing Units, occupied or vacant, in the geographic area. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters. Occupants can be individuals, roommates, families who live together, or any other group of related or unrelated people who share living arrangements. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHUFY":{"id":"TOTHU_FY","fullName":"housingunittotals.TOTHU_FY","alias":"2028 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHUFY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHUFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Total Housing Units (occupied or vacant) in the geographic area. Occupied Housing Units are currently occupied living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. Occupants can be individuals, unrelated roommates, or families who live together. For vacant housing units, the living space criteria is identical to that of occupied units. Some nontraditional living quarters—such as boats, RVs, and tents—are counted as housing units only when occupied if it is either the occupant’s usual residence or if the occupant has no other residence elsewhere. Importantly, these nontraditional living quarters are not counted as vacant housing units when unoccupied. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU00":{"id":"TOTHU00","fullName":"housingunittotals.TOTHU00","alias":"2000 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU00","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU00","type":"esriFieldTypeDouble","vintage":"2000","source":"U.S. Census","definition":"U.S. Census 2010 count of Total Housing Units in the geographic area. Total Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupant’s usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Based on U.S. Census 2010 data. See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"dataCollectionsCalculator.AGEBYRACEBYSEX2010TOTHH10":{"id":"TOTHH10","fullName":"agebyracebysex2010.TOTHH10","alias":"2010 Total Households","fieldName":"AGEBYRACEBYSEX2010TOTHH10","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.AGEBYRACEBYSEX2010TOTHH10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence.See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH20":{"id":"TOTHH20","fullName":"householdtotals.TOTHH20","alias":"2020 Total Households","fieldName":"HOUSEHOLDTOTALSTOTHH20","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"Total Households is the total of occupied housing units. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered gr
